}
.works-items li {
  position: relative;
  margin: 10px;
  height: 400px;
  overflow: hidden;
  transition: 0.8s;
}
.works-items li:nth-child(2) img {
  opacity: 0.8;
}
.works-items li img {
  height: 400px;
  width: 100%;
  transition: 0.8s;
}
.works-items li div {
  position: absolute;
  padding: 20px;
  bottom: 0;
  left: 0;
  opacity: 0;
  color: white;
  transition: 0.8s;
}
.works-items li div h3 {
  color: white;
  margin: 15px 0;
  font-size: 20px;
}
.works-items li div p {
  color: white;
  margin: 15px 0;
}
.works-items li div a {
  display: inline-block;
  color: white;
  margin: 0px 10px 10px 0;
  padding: 10px;
  border: solid 1px rgba(255, 255, 255, 0.596);
  transition: 0.3s;
}
.works-items li div a:hover {
  border: solid 1px #ffffff;
  box-shadow: 0 0 1px 1px white;
}
.works-items li:hover {
  background: rgba(52, 152, 219, 0.9);
}
.works-items li:hover img {
  transform: scale(1.2);
  opacity: 0.1;
}
.works-items li:hover div {
  opacity: 1;
}
* {
  margin: 0px;
  padding: 0px;
  color: black;
  text-decoration: none;
  list-style: none;
  border: none;
}
body {
  background-color: #eaeaea;
  font-family: 'Roboto', sans-serif;
}
